import React, { useState, useContext } from 'react'
import { AppContext } from '../App';
import { Link } from "react-router-dom"

function Address() {
    const { address } = useContext(AppContext)
    return (
        <div>
            <div class="list-group">
                <ul class="list-group list-group-flush">
                    <li class="list-group-item">Street   : {address.street ? address.street : 'No Data'}</li>
                    <li class="list-group-item">Suite    : {address.suite}</li>
                    <li class="list-group-item">City     : {address.city}</li>
                    <li class="list-group-item">Zipcode  : {address.zipcode}</li>
                    <li class="list-group-item">{address.street}</li>
                </ul>
            </div>


        </div>
    )
}

export default Address
